import React from "react";
import { Helmet } from "react-helmet";

const Contact = () => {
  return (
    <div>
      <Helmet>
        <title>CRWN Clothing | Contact</title>
      </Helmet>
      <h1>Contact</h1>
    </div>
  );
};

export default Contact;
